public int compareTo(Object obj) {
  if (obj == null || (!(obj instanceof  GpuDevice))) {
    return -1;
  }

  GpuDevice other = (GpuDevice) obj;

  int result = Integer.compare(index, other.index);
  if (0 != result) {
    return result;
  }
  return Integer.compare(minorNumber, other.minorNumber);
}
